var sh = WScript.CreateObject("WScript.Shell");
var fso = WScript.CreateObject("Scripting.FileSystemObject");
var userDir = sh.ExpandEnvironmentStrings("%USERPROFILE%");
var configFilePath = userDir + "\\.ssh\\config";
var connectExePath = fso.GetFile(WScript.ScriptFullName).ParentFolder.Path+"\\connect.exe";

WScript.Echo("The ssh config \"" + configFilePath + "\" will be overwrited.\nThe default proxy is socks5://127.0.0.1:10808");
function heredoc(fn) {
    return fn.toString().split('\n').slice(1, -1).join('\n') + '\n'
}

var src = heredoc(function() {/*

*/});
var configSrc = "\
Host *\
	#-S参数表示使用Socks5代理, 如果是HTTP代理则为-H\n\
	ProxyCommand "+connectExePath+" -S 127.0.0.1:10808 %h %p\n\
	# 断开时重试连接的次数\n\
	ServerAliveCountMax 5\n\
	# 每隔30秒自动发送一个空的请求以保持连接\n\
	ServerAliveInterval 30\n\
";

var file = fso.CreateTextFile("connect.exe", true);
file.WriteLine(src);
file.Close();
sh.Run("certutil -f -decode connect.exe connect.exe");

var configFile;
if (!fso.FileExists(configFilePath)) {
    configFile = fso.CreateTextFile(configFilePath, true);
} else {
    configFile = fso.GetFile(configFilePath).OpenAsTextStream(2,-2);
}
configFile.Write(configSrc);

